import React from 'react';
import Service from "../../repository/Repository";
import {useLocation} from "react-router-dom";
import { Link } from "react-router-dom";

const SearchResult = ({ data }) => {
    const location=useLocation()
    const mydata=location.state
    const onFormSubmit =async (e) => {
        e.preventDefault();
        console.log(mydata)
    }
    return (
        <div>
            <div>
                <p>"There have been many different literary movements throughout history, each with its own unique characteristics and contributions to the world of literature. Some of the most well-known literary movements include Romanticism, Realism, Naturalism, Modernism, and Postmodernism. Romanticism, for example, emphasized emotion, individualism, and the beauty of nature, while Realism sought to depict the world as it really is, often with a focus on the lives of ordinary people. Naturalism, on the other hand, portrayed humans as being shaped by their environment and biology, while Modernism and Postmodernism explored new forms of expression and challenged traditional notions of narrative and authorship. If you're interested in learning more about these literary movements and the works they produced, click the buttons below to explore some of our curated collections of literature."</p>
                <div className="d-flex justify-content-center">
                    <Link className="btn btn-primary mx-2" to="/romanticism">Romanticism</Link>
                    <Link className="btn btn-primary mx-2" to="/literaryrealism">Literary Realism</Link>
                </div>
            </div>
        </div>
    );
};

export default SearchResult;
